INSERT INTO `detail_commentinfo` VALUES ('冬泳乖鸽', 'project_one_server\\public\\pic\\detail\\comment\\avatar\\1.jpg', , '本作的主角，自卑而温柔的少年，心思单纯，容易轻易信服别人，被国木田称为“万年常春头”。自小在孤儿院长大，因为自己的能力而被孤儿院驱逐，后加入武装侦探社。害怕给别人添麻烦，认为自己给周围的人带来了不幸，因为武装侦探社收留了自己而对侦探社的人尤其是太宰感激有加。\r\n虎化时拥有极强的再生能力、力量以及速度，子弹也无法使其受到伤害。早期无法自己控制能力，完全虎化时丧失理智，解除虎化后会陷入昏睡，对虎化状态下的行为没有记忆；后期开始自主控制身体部分虎化，虎化时有自主意识。\r\n作为”人虎“在黑道中被“钟塔侍从”、“死屋之鼠”与“组合”三家联合悬赏70亿，曾被“组合”控制下黑手党的芥川擒获，后战胜镜花加入武装侦探社。因宿舍不够所以被太宰安排与镜花同住一间宿舍。');
